dfp_read_field_def_FileDescriptorSet(<<10,
                                       Rest/binary>>,
                                     Z1, Z2, F@_1, TrUserData) ->
    d_field_FileDescriptorSet_file(Rest,
                                   Z1,
                                   Z2,
                                   F@_1,
                                   TrUserData);
dfp_read_field_def_FileDescriptorSet(<<>>, 0, 0, R1,
                                     TrUserData) ->
    #'FileDescriptorSet'{file =
                             lists_reverse(R1, TrUserData)};
dfp_read_field_def_FileDescriptorSet(Other, Z1, Z2,
                                     F@_1, TrUserData) ->
    dg_read_field_def_FileDescriptorSet(Other,
                                        Z1,
                                        Z2,
                                        F@_1,
                                        TrUserData).

dg_read_field_def_FileDescriptorSet(<<1:1, X:7,
                                      Rest/binary>>,
                                    N, Acc, F@_1, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_FileDescriptorSet(Rest,
                                        N + 7,
                                        X bsl N + Acc,
                                        F@_1,
                                        TrUserData);
dg_read_field_def_FileDescriptorSet(<<0:1, X:7,
                                      Rest/binary>>,
                                    N, Acc, F@_1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
        10 ->
            d_field_FileDescriptorSet_file(Rest,
                                           0,
                                           0,
                                           F@_1,
                                           TrUserData);
        _ ->
            case Key band 7 of
                0 ->
                    skip_varint_FileDescriptorSet(Rest,
                                                  0,
                                                  0,
                                                  F@_1,
                                                  TrUserData);
                1 ->
                    skip_64_FileDescriptorSet(Rest, 0, 0, F@_1, TrUserData);
                2 ->
                    skip_length_delimited_FileDescriptorSet(Rest,
                                                            0,
                                                            0,
                                                            F@_1,
                                                            TrUserData);
                3 ->
                    skip_group_FileDescriptorSet(Rest,
                                                 Key bsr 3,
                                                 0,
                                                 F@_1,
                                                 TrUserData);
                5 ->
                    skip_32_FileDescriptorSet(Rest, 0, 0, F@_1, TrUserData)
            end
    end;
dg_read_field_def_FileDescriptorSet(<<>>, 0, 0, R1,
                                    TrUserData) ->
    #'FileDescriptorSet'{file =
                             lists_reverse(R1, TrUserData)}.

d_field_FileDescriptorSet_file(<<1:1, X:7,
                                 Rest/binary>>,
                               N, Acc, F@_1, TrUserData)
    when N < 57 ->
    d_field_FileDescriptorSet_file(Rest,
                                   N + 7,
                                   X bsl N + Acc,
                                   F@_1,
                                   TrUserData);
d_field_FileDescriptorSet_file(<<0:1, X:7,
                                 Rest/binary>>,
                               N, Acc, Prev, TrUserData) ->
    {NewFValue, RestF} = begin
                             Len = X bsl N + Acc,
                             <<Bs:Len/binary, Rest2/binary>> = Rest,
                             {id(decode_msg_FileDescriptorProto(Bs, TrUserData),
                                 TrUserData),
                              Rest2}
                         end,
    dfp_read_field_def_FileDescriptorSet(RestF,
                                         0,
                                         0,
                                         cons(NewFValue, Prev, TrUserData),
                                         TrUserData).

skip_varint_FileDescriptorSet(<<1:1, _:7, Rest/binary>>,
                              Z1, Z2, F@_1, TrUserData) ->
    skip_varint_FileDescriptorSet(Rest,
