                    'skip_length_delimited_GeneratedCodeInfo.Annotation'(Rest,
                                                                         0,
                                                                         0,
                                                                         F@_1,
                                                                         F@_2,
                                                                         F@_3,
                                                                         F@_4,
                                                                         TrUserData);
                3 ->
                    'skip_group_GeneratedCodeInfo.Annotation'(Rest,
                                                              Key bsr 3,
                                                              0,
                                                              F@_1,
                                                              F@_2,
                                                              F@_3,
                                                              F@_4,
                                                              TrUserData);
                5 ->
                    'skip_32_GeneratedCodeInfo.Annotation'(Rest,
                                                           0,
                                                           0,
                                                           F@_1,
                                                           F@_2,
                                                           F@_3,
                                                           F@_4,
                                                           TrUserData)
            end
    end;
'dg_read_field_def_GeneratedCodeInfo.Annotation'(<<>>,
                                                 0, 0, R1, F@_2, F@_3, F@_4,
                                                 TrUserData) ->
    #'GeneratedCodeInfo.Annotation'{path =
                                        lists_reverse(R1, TrUserData),
                                    source_file = F@_2, 'begin' = F@_3,
                                    'end' = F@_4}.

'd_field_GeneratedCodeInfo.Annotation_path'(<<1:1, X:7,
                                              Rest/binary>>,
                                            N, Acc, F@_1, F@_2, F@_3, F@_4,
                                            TrUserData)
    when N < 57 ->
    'd_field_GeneratedCodeInfo.Annotation_path'(Rest,
                                                N + 7,
                                                X bsl N + Acc,
                                                F@_1,
                                                F@_2,
                                                F@_3,
                                                F@_4,
                                                TrUserData);
'd_field_GeneratedCodeInfo.Annotation_path'(<<0:1, X:7,
                                              Rest/binary>>,
                                            N, Acc, Prev, F@_2, F@_3, F@_4,
                                            TrUserData) ->
    {NewFValue, RestF} = {begin
                              <<Res:32/signed-native>> = <<(X bsl N +
                                                                Acc):32/unsigned-native>>,
                              id(Res, TrUserData)
                          end,
                          Rest},
    'dfp_read_field_def_GeneratedCodeInfo.Annotation'(RestF,
                                                      0,
                                                      0,
                                                      cons(NewFValue,
                                                           Prev,
                                                           TrUserData),
                                                      F@_2,
                                                      F@_3,
                                                      F@_4,
                                                      TrUserData).

'd_pfield_GeneratedCodeInfo.Annotation_path'(<<1:1, X:7,
                                               Rest/binary>>,
                                             N, Acc, F@_1, F@_2, F@_3, F@_4,
                                             TrUserData)
    when N < 57 ->
    'd_pfield_GeneratedCodeInfo.Annotation_path'(Rest,
