'd_pfield_GeneratedCodeInfo.Annotation_path'(<<0:1, X:7,
                                               Rest/binary>>,
                                             N, Acc, E, F@_2, F@_3, F@_4,
                                             TrUserData) ->
    Len = X bsl N + Acc,
    <<PackedBytes:Len/binary, Rest2/binary>> = Rest,
    NewSeq =
        'd_packed_field_GeneratedCodeInfo.Annotation_path'(PackedBytes,
                                                           0,
                                                           0,
                                                           E,
                                                           TrUserData),
    'dfp_read_field_def_GeneratedCodeInfo.Annotation'(Rest2,
                                                      0,
                                                      0,
                                                      NewSeq,
                                                      F@_2,
                                                      F@_3,
                                                      F@_4,
                                                      TrUserData).

'd_packed_field_GeneratedCodeInfo.Annotation_path'(<<1:1,
                                                     X:7, Rest/binary>>,
