dfp_read_field_def_GeneratedCodeInfo(<<10,
                                       Rest/binary>>,
                                     Z1, Z2, F@_1, TrUserData) ->
    d_field_GeneratedCodeInfo_annotation(Rest,
                                         Z1,
                                         Z2,
                                         F@_1,
                                         TrUserData);
dfp_read_field_def_GeneratedCodeInfo(<<>>, 0, 0, R1,
                                     TrUserData) ->
    #'GeneratedCodeInfo'{annotation =
                             lists_reverse(R1, TrUserData)};
dfp_read_field_def_GeneratedCodeInfo(Other, Z1, Z2,
                                     F@_1, TrUserData) ->
    dg_read_field_def_GeneratedCodeInfo(Other,
                                        Z1,
                                        Z2,
                                        F@_1,
                                        TrUserData).

dg_read_field_def_GeneratedCodeInfo(<<1:1, X:7,
                                      Rest/binary>>,
                                    N, Acc, F@_1, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_GeneratedCodeInfo(Rest,
                                        N + 7,
                                        X bsl N + Acc,
                                        F@_1,
                                        TrUserData);
dg_read_field_def_GeneratedCodeInfo(<<0:1, X:7,
                                      Rest/binary>>,
                                    N, Acc, F@_1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
        10 ->
            d_field_GeneratedCodeInfo_annotation(Rest,
                                                 0,
                                                 0,
                                                 F@_1,
                                                 TrUserData);
        _ ->
            case Key band 7 of
                0 ->
                    skip_varint_GeneratedCodeInfo(Rest,
                                                  0,
                                                  0,
                                                  F@_1,
                                                  TrUserData);
                1 ->
                    skip_64_GeneratedCodeInfo(Rest, 0, 0, F@_1, TrUserData);
                2 ->
                    skip_length_delimited_GeneratedCodeInfo(Rest,
                                                            0,
                                                            0,
                                                            F@_1,
                                                            TrUserData);
                3 ->
                    skip_group_GeneratedCodeInfo(Rest,
                                                 Key bsr 3,
                                                 0,
                                                 F@_1,
                                                 TrUserData);
                5 ->
                    skip_32_GeneratedCodeInfo(Rest, 0, 0, F@_1, TrUserData)
            end
    end;
dg_read_field_def_GeneratedCodeInfo(<<>>, 0, 0, R1,
                                    TrUserData) ->
    #'GeneratedCodeInfo'{annotation =
                             lists_reverse(R1, TrUserData)}.

d_field_GeneratedCodeInfo_annotation(<<1:1, X:7,
                                       Rest/binary>>,
                                     N, Acc, F@_1, TrUserData)
    when N < 57 ->
    d_field_GeneratedCodeInfo_annotation(Rest,
                                         N + 7,
                                         X bsl N + Acc,
                                         F@_1,
                                         TrUserData);
d_field_GeneratedCodeInfo_annotation(<<0:1, X:7,
                                       Rest/binary>>,
                                     N, Acc, Prev, TrUserData) ->
    {NewFValue, RestF} = begin
                             Len = X bsl N + Acc,
                             <<Bs:Len/binary, Rest2/binary>> = Rest,
                             {id('decode_msg_GeneratedCodeInfo.Annotation'(Bs,
                                                                           TrUserData),
                                 TrUserData),
                              Rest2}
                         end,
    dfp_read_field_def_GeneratedCodeInfo(RestF,
                                         0,
                                         0,
                                         cons(NewFValue, Prev, TrUserData),
                                         TrUserData).

skip_varint_GeneratedCodeInfo(<<1:1, _:7, Rest/binary>>,
                              Z1, Z2, F@_1, TrUserData) ->
