verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'FileDescriptorSet' ->
            v_msg_FileDescriptorSet(Msg, [MsgName], TrUserData);
        'FileDescriptorProto' ->
            v_msg_FileDescriptorProto(Msg, [MsgName], TrUserData);
        'DescriptorProto.ExtensionRange' ->
            'v_msg_DescriptorProto.ExtensionRange'(Msg,
                                                   [MsgName],
                                                   TrUserData);
        'DescriptorProto.ReservedRange' ->
            'v_msg_DescriptorProto.ReservedRange'(Msg,
                                                  [MsgName],
                                                  TrUserData);
        'DescriptorProto' ->
            v_msg_DescriptorProto(Msg, [MsgName], TrUserData);
        'FieldDescriptorProto' ->
            v_msg_FieldDescriptorProto(Msg, [MsgName], TrUserData);
        'OneofDescriptorProto' ->
            v_msg_OneofDescriptorProto(Msg, [MsgName], TrUserData);
        'EnumDescriptorProto' ->
            v_msg_EnumDescriptorProto(Msg, [MsgName], TrUserData);
        'EnumValueDescriptorProto' ->
            v_msg_EnumValueDescriptorProto(Msg,
                                           [MsgName],
                                           TrUserData);
        'ServiceDescriptorProto' ->
            v_msg_ServiceDescriptorProto(Msg,
                                         [MsgName],
                                         TrUserData);
        'MethodDescriptorProto' ->
            v_msg_MethodDescriptorProto(Msg, [MsgName], TrUserData);
        'FileOptions' ->
            v_msg_FileOptions(Msg, [MsgName], TrUserData);
        'MessageOptions' ->
            v_msg_MessageOptions(Msg, [MsgName], TrUserData);
        'FieldOptions' ->
            v_msg_FieldOptions(Msg, [MsgName], TrUserData);
        'EnumOptions' ->
            v_msg_EnumOptions(Msg, [MsgName], TrUserData);
        'EnumValueOptions' ->
            v_msg_EnumValueOptions(Msg, [MsgName], TrUserData);
        'ServiceOptions' ->
            v_msg_ServiceOptions(Msg, [MsgName], TrUserData);
        'MethodOptions' ->
            v_msg_MethodOptions(Msg, [MsgName], TrUserData);
        'UninterpretedOption.NamePart' ->
            'v_msg_UninterpretedOption.NamePart'(Msg,
                                                 [MsgName],
                                                 TrUserData);
        'UninterpretedOption' ->
            v_msg_UninterpretedOption(Msg, [MsgName], TrUserData);
        'SourceCodeInfo.Location' ->
            'v_msg_SourceCodeInfo.Location'(Msg,
                                            [MsgName],
                                            TrUserData);
        'SourceCodeInfo' ->
            v_msg_SourceCodeInfo(Msg, [MsgName], TrUserData);
        'GeneratedCodeInfo.Annotation' ->
            'v_msg_GeneratedCodeInfo.Annotation'(Msg,
                                                 [MsgName],
                                                 TrUserData);
        'GeneratedCodeInfo' ->
            v_msg_GeneratedCodeInfo(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


